export default function ContentView(props: any) {
    const examples = [];
    for (var i = 0; i < 60; i++) {
        examples.push(i);
    }
    return(
        <div className={`content-view${props.type === "album" ? "-album" : "-playlist"}`}>
            <div className="content-header">

            </div>

            <div className="content-body">
                {examples.map((x) => 
                    <p>This is an example</p>
                )}
            </div>
        </div>
    )
}
